import "./App.css";
import Producten from './components/Producten'
// import {useState} from "react";
// import Axios from "axios";
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'

function App() {


   return <Router>
       <Switch>
           <Route path="/product" component={Producten}/>
       </Switch>
   </Router>
}

export default App;
